query GetZoneAnalytics($zoneTag: string, $since: string, $until: string) {
  viewer {
    zones(filter: {zoneTag: $zoneTag}) {
      totals: httpRequests1hGroups(limit: 10000, filter: {datetime_geq: $since, datetime_lt: $until}) {
        uniq {
          uniques
          __typename
        }
        __typename
      }
      zones: httpRequests1hGroups(orderBy: [datetime_ASC], limit: 10000, filter: {datetime_geq: $since, datetime_lt: $until}) {
        dimensions {
          timeslot: datetime
          __typename
        }
        uniq {
          uniques
          __typename
        }
        sum {
          browserMap {
            pageViews
            key: uaBrowserFamily
            __typename
          }
          bytes
          cachedBytes
          cachedRequests
          contentTypeMap {
            bytes
            requests
            key: edgeResponseContentTypeName
            __typename
          }
          clientSSLMap {
            requests
            key: clientSSLProtocol
            __typename
          }
          countryMap {
            bytes
            requests
            threats
            key: clientCountryName
            __typename
          }
          encryptedBytes
          encryptedRequests
          ipClassMap {
            requests
            key: ipType
            __typename
          }
          pageViews
          requests
          responseStatusMap {
            requests
            key: edgeResponseStatus
            __typename
          }
          threats
          threatPathingMap {
            requests
            key: threatPathingName
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
